Layout root component. Replaces the view "root" content if the layout is used.

      The layout component hierarchy wraps the view content areas in additional markup. For a normal layout there
      should be one Content component with no name attribute (which defaults to {@link View#MAIN}). Some layouts may
      define additional view model defined areas in the layout, like in a sidebar or a footer.

      @see View#ROOT
      @see View#MAIN

      @return  root component

